    return (
        <Grid item xs={12} sm={4}>
            <Card>
                <CardContent>
                    <Avatar sx={{ height: '90px', width: '90px', bgcolor: green[400] }}>
                        <Groups fontSize="large" sx={{ height: '50px', width: '50px' }} />
                    </Avatar>
                </CardContent>
                <CardContent>
                    <Typography variant="h5">
                        Team
                    </Typography>
                </CardContent>
                <CardContent>
                   <Typography variant="body2">
                        Lorem ipsum dolor sit amet consectetur adipisicing elit. Aspernatur mollitia saepe dolorum nobis recusandae, ullam amet quibusdam. Alias consequatur debitis at sunt ipsam repellendus odio, aut, veniam, recusandae distinctio voluptates.
                   </Typography>
                </CardContent>
            </Card>
        </Grid>
    ); 
};

export default CreateTeam;
